export class OrganizationInvitation {
    constructor(id, emailAddress, role, organizationId, createdAt, updatedAt, status) {
        this.id = id;
        this.emailAddress = emailAddress;
        this.role = role;
        this.organizationId = organizationId;
        this.createdAt = createdAt;
        this.updatedAt = updatedAt;
        this.status = status;
    }
    static fromJSON(data) {
        return new OrganizationInvitation(data.id, data.email_address, data.role, data.organization_id, data.created_at, data.updated_at, data.status);
    }
}
